	public static int regex_value(Map map,String s ){
		
		String str = new Gson().toJson(map.get(s));
		Pattern p=Pattern.compile("\"value\":[0-9]+");
		Matcher m = p.matcher(str);
		m.find();
		int id = Integer.parseInt(m.group().substring(8));
		return id;
	}
